Some foreign functions, especially ones defined in C, could be variadic functions . These functions are usually defined with the last parameter ..., and signify that a function can be called with unlimited parameters. An example of a variadic function is printf. Calling a variadic function is supported in ST. To mark an external function as variadic, you can add a parameter of type ... to the VAR_INPUT block. Variadic function example Given the printf function defined as: int printf( const char *restrict format, ... ); the ST interface can be defined as: {external}
FUNCTION printf : DINT
VAR_INPUT {ref} format : STRING;
END_VAR
VAR_INPUT args : ...;
END_VAR
END_FUNCTION Runnable example With the printf function available on the system, there is no need to declare the C function. An ST program called ExternalFunctions.st with the following code can be declared: (*ExternalFunctions.st*) (** * The printf function's interface, marked as external since * it is defined directly along other ST functions *)
{external}
FUNCTION printf : DINT
VAR_INPUT {ref} format : STRING;
END_VAR
VAR_INPUT args: ...;
END_VAR
END_FUNCTION (**
* The main function of the program prints a demo to the standard out
* The function main is implemented at this location and thus not marked
* as {external}
*)
FUNCTION main : DINT
VAR tmp : DINT;
END_VAR tmp := 1; printf('Value %d, %d, %d$N', tmp, tmp * 10, tmp * 100); main := tmp;
END_FUNCTION Compiling the previous code with the following command: plc ExternalFunctions.st -o ExternalFunctions --linker=clang will yield an executable called ExternalFunctions. We use clang to link the generated object file and generate an executable since the embedded linker cannot generate executable files. The executable can then be started with ./ExternalFunctions.

