FUNCTION and FUNCTION_BLOCK have similar properties, but they have fundamentally different representation in the compiler. A FUNCTION is defined in a similar manner to a C function: It has no backing struct values defined inside it will only persist for the duration of the function call Example: FUNCTION myFunc : DINT
VAR_INPUT x : DINT;
END_VAR
END_FUNCTION int32_t myFunc(int32_t); In contrast, a FUNCTION_BLOCK is backed by a struct and is globally accessible by a defined instance. To declare a FUNCTION_BLOCK, a backing struct has to be declared and passed as a reference to the function block implementation. FUNCTION_BLOCK myFb
VAR_INPUT x : DINT;
END_VAR
END_FUNCTION_BLOCK typedef struct { int32_t x;
} myFunctStr; void myFb(myFunctStr*); 2.2.1 Parameters FUNCTION and FUNCTION_BLOCK may define input parameters. These are passed using the VAR_INPUT or VAR_IN_OUT blocks. The difference between the two blocks is how the values are passed. A VAR_INPUT variable is passed by value , while a VAR_IN_OUT variable is passed by reference . In general, it is recommended to use a VAR_IN_OUT for data that needs to be both read and written, while VAR_INPUT should be reserved to read only values. NOTE: In FUNCTIONs complex datatypes are handled as pointers. They are however copied and changes in the function will have no effect on the actual variable. Examples: FUNCTION: FUNCTION myFunc : DINT
VAR_INPUT myInt : DINT; myString : STRING[255];
END_VAR VAR_INPUT myRefStr : STRING;
END_VAR VAR_IN_OUT myInOutInt : DINT;
END_VAR
END_FUNCTION int32_t myFunc(int32_t myInt, char* myString, char* myRefStr, int32_t* myInOutInt); FUNCTION_BLOCK: FUNCTION_BLOCK myFb
VAR_INPUT myInt : DINT; myString : STRING[255];
END_VAR VAR_IN_OUT myInOutInt : DINT;
END_VAR
END_FUNCTION_BLOCK typedef struct { int32_t myInt; char myString[256]; int32_t* myInOutInt;
} myFbStruct void myFb(myFbStruct* myFbInstance); 2.2.2 Private members A FUNCTION_BLOCK often requires local (private) members to hold data across executions. These members have to be declared in the struct. As a side effect, these variables are visible to the users. For example: FUNCTION_BLOCK Count
VAR current : DINT;
END_VAR
END_FUNCTION_BLOCK typedef struct { int32_t current;
} CountStruct; void Count(CountStruct* countInst) { countInst->current = countInst->current + 1;
} 2.2.3 Return values A FUNCTION defines a return value in the signature, while a FUNCTION_BLOCK relies on VAR_OUTPUT definitions. Example: FUNCTION myFunc : DINT VAR_INPUT x : DINT; END_VAR VAR_IN_OUT y : DINT; END_VAR
END_FUNCTION The C interface would look like: int32_t myFunc(int32_t x, int32_t* y); The return type for a function can also include complex datatypes, such as strings, arrays and structs. Internally, complex return types are treated as reference parameters (pointers). For complex return types, the function signature expects the return value as the first parameter. Example: FUNCTION myFunc : STRING VAR_INPUT x : DINT; END_VAR VAR_IN_OUT y : DINT; END_VAR
END_FUNCTION The C interface would look like: void myFunc(char* out, int32_t x, int32_t* y); A FUNCTION_BLOCK should use VAR_OUTPUT for return values. Avoid using a pointer in the VAR_INPUT as a return value. Example: FUNCTION_BLOCK myFb VAR_INPUT x : DINT; END_VAR VAR_IN_OUT y : DINT; END_VAR VAR_OUTPUT myOut: DINT; myOut2: STRING[255]; END_VAR
END_FUNCTION The C interface would look like: typedef struct { int32_t x; int32_t* y; int32_t myOut; char myOut2[256]; } myFbStruct; void myFb(myFbStruct* myFbInst);

