POUs can use input, output, or in/out parameters to pass data to the outside. Such parameters are defined in a variable block delimeted by VAR_<TYPE> and END_VAR Supported parameter types are VAR_INPUT, VAR_INPUT {ref}, VAR_OUTPUT and VAR_IN_OUT Input Input parameters are typically copied into the target POU to be stored and read for later references. A definition for input parameters is as follows: VAR_INPUT a : INT;
END_VAR In some cases, especially when passing large strings or arrays, or when interacting with foreign code (see External Functions ) it is more efficient to avoid copying the variable values and just use a pointer to the required input. This can be done either using the in/out variables or by specifying a special property ref on the input block. Example: VAR_INPUT {ref} a : STRING;
END_VAR Note that passing the ref property will convert all variables in that block to pointers, and should only be used in Functions. In Out In/Out parameters are required parameters that are always passed by reference. They can be modified by the POU the call, and the changes are applied directly to the passed variable. An In/Out parameter must always be passed in a POU call and cannot be stored. Output Output parameters are used to return the result(s) of the POU call. They are passed by reference, but are optional. If an output parameter is not passed in a call, its value is not persisted.

